import {NavLink} from 'react-router-dom';
import {Navbar,Nav} from 'react-bootstrap';
import { Link } from 'react-router-dom'
 
const Navigation = () => {
    return ( 
        <nav className="navbar">
            <h1>MyBlog</h1>
            <div className="links">
                <Link to="/">
                    <li>home</li>
                </Link>
                <Link to="/restoranti">Restoranti</Link>
            </div>
        </nav>
    );
}
 
export default Navigation;
